import os
import errno
import tkinter as tk
from tkinter import filedialog, messagebox, ttk

import base64
from io import BytesIO
from PIL import Image, ImageTk  # Certifique-se de ter Pillow instalado

# Strings base64 para as imagens
icon_base64 = ""

def load_icon_from_base64(base64_string, size=(32, 32)):
    image_data = base64.b64decode(base64_string)
    image = Image.open(BytesIO(image_data))
    image = image.resize(size, Image.LANCZOS)  # Redimensiona a imagem
    return ImageTk.PhotoImage(image)

def criar_estrutura(arquivo_estrutura):
    if not os.path.exists(arquivo_estrutura):
        raise FileNotFoundError(errno.ENOENT, os.strerror(errno.ENOENT), arquivo_estrutura)
    
    with open(arquivo_estrutura, 'r', encoding='utf-8') as file:
        linhas = file.readlines()
    
    path_atual = []

    for linha in linhas:
        nivel = (len(linha) - len(linha.lstrip(' '))) // 4
        nome = linha.strip()

        path_atual = path_atual[:nivel]

        if nome.endswith('/'):
            path_atual.append(nome[:-1])
            caminho_completo = os.path.join(*path_atual)
            try:
                os.makedirs(caminho_completo, exist_ok=True)
            except OSError as e:
                if e.errno != errno.EEXIST:
                    raise
        else:
            path_atual.append(nome)
            caminho_completo = os.path.join(*path_atual)
            try:
                os.makedirs(os.path.dirname(caminho_completo), exist_ok=True)
            except OSError as e:
                if e.errno != errno.EEXIST:
                    raise
            try:
                with open(caminho_completo, 'w', encoding='utf-8') as f:
                    if nome.endswith('.md'):
                        f.write('# ' + nome[:-3] + '\n')
                    elif nome.endswith('.ps1'):
                        f.write('# ' + nome + ' - PowerShell script\n')
                    else:
                        f.write('# ' + nome + '\n')
            except OSError as e:
                raise PermissionError(f"Não foi possível criar o arquivo {caminho_completo}: {e}")
        
        if not nome.endswith('/'):
            path_atual.pop()

def selecionar_arquivo():
    arquivo_path = filedialog.askopenfilename(
        title="Selecione o arquivo de estrutura",
        filetypes=(("Text files", "*.txt"), ("All files", "*.*"))
    )
    if arquivo_path:
        try:
            criar_estrutura(arquivo_path)
            messagebox.showinfo("Sucesso", "Estrutura de diretórios e arquivos criada com sucesso.")
        except Exception as e:
            messagebox.showerror("Erro", f"Erro ao criar estrutura: {e}")

# Configurando a interface gráfica
janela = tk.Tk()
janela.title("Criar Estrutura de Diretórios")
janela.geometry("400x100")

# Definindo ícone da janela
window_icon = load_icon_from_base64(icon_base64, size=(64, 64))
janela.iconphoto(False, window_icon)

# Estilos
style = ttk.Style()
style.configure("TButton", font=("Helvetica", 10))
style.configure("TLabel", font=("Helvetica", 12))

frame = ttk.Frame(janela, padding="10")
frame.pack(fill=tk.BOTH, expand=True)

# Configurando a coluna para expandir e centralizar widgets
frame.grid_columnconfigure(0, weight=1)

# Botão para selecionar o arquivo
btn_selecionar_arquivo = tk.Button(janela, text="Selecionar Arquivo", command=selecionar_arquivo)
btn_selecionar_arquivo.pack(pady=20)

# Iniciar a interface gráfica
janela.mainloop()
